// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// Importa proteção contra reentrância (ataques em funções de pagamento)
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

// Contrato principal
contract PrestacaoServicoSeguro is ReentrancyGuard {
    // Enum para representar o estado atual do serviço
    enum Status { Criado, Aceito, EmAndamento, Concluido, Cancelado }

    // Estrutura que representa cada parte envolvida no contrato
    struct Parte {
        address carteira; // Endereço da carteira da parte
        string nome;      // Nome ou papel (ex: "Contratante")
        bool aceitou;     // Indicador se a parte aceitou o contrato
    }

    // Estrutura que representa os dados do serviço
    struct Servico {
        string descricao;             // Descrição do serviço
        uint256 valor;                // Valor acordado em wei
        Status status;                // Estado atual do serviço
        address contratado;           // Endereço do contratado
        address contratante;          // Endereço do contratante
        address intermediador;        // Endereço do intermediador (opcional)
        address advogado;             // Endereço do advogado responsável
        bool reconhecidoJuridicamente;// Indica se o contrato foi validado juridicamente
        string ipfsLinkTermos;        // Link IPFS para os termos em papel (via Pinata)
    }

    Servico public servico; // Instância única do serviço
    mapping(address => Parte) public partes; // Mapeia cada parte pelo endereço
    address[] public listaPartes; // Lista de endereços das partes

    // Eventos para auditoria e rastreabilidade
    event ContratoAceito(address parte);
    event ServicoIniciado();
    event ServicoConcluido();
    event ReconhecimentoJuridico(address advogado);
    event PagamentoRealizado(address pagador, uint256 valor);
    event ContratoCancelado(address parte);

    // Construtor: inicializa o contrato com os dados das partes e do serviço
    constructor(
        address _contratante,
        address _contratado,
        address _intermediador,
        address _advogado,
        string memory _descricao,
        uint256 _valor,
        string memory _ipfsLinkTermos
    ) {
        require(_contratante != address(0) && _contratado != address(0), "Enderecos invalidos");
        require(_advogado != address(0), "Advogado obrigatorio");

        servico = Servico({
            descricao: _descricao,
            valor: _valor,
            status: Status.Criado,
            contratado: _contratado,
            contratante: _contratante,
            intermediador: _intermediador,
            advogado: _advogado,
            reconhecidoJuridicamente: false,
            ipfsLinkTermos: _ipfsLinkTermos
        });

        // Registra as partes envolvidas
        partes[_contratante] = Parte(_contratante, "Contratante", false);
        partes[_contratado] = Parte(_contratado, "Contratado", false);
        partes[_intermediador] = Parte(_intermediador, "Intermediador", false);
        partes[_advogado] = Parte(_advogado, "Advogado", false);

        listaPartes.push(_contratante);
        listaPartes.push(_contratado);
        listaPartes.push(_intermediador);
        listaPartes.push(_advogado);
    }

    // Modificador: restringe acesso às partes registradas
    modifier apenasParte() {
        require(partes[msg.sender].carteira != address(0), "Nao autorizado");
        _;
    }

    // Modificador: apenas o advogado pode executar
    modifier apenasAdvogado() {
        require(msg.sender == servico.advogado, "Somente o advogado pode executar");
        _;
    }

    // Modificador: apenas o contratado pode executar
    modifier apenasContratado() {
        require(msg.sender == servico.contratado, "Somente o contratado pode executar");
        _;
    }

    // Modificador: apenas o contratante pode executar
    modifier apenasContratante() {
        require(msg.sender == servico.contratante, "Somente o contratante pode executar");
        _;
    }

    // Função para aceitar o contrato por qualquer parte envolvida
    function aceitarContrato() public apenasParte {
        require(!partes[msg.sender].aceitou, "Ja aceitou");
        partes[msg.sender].aceitou = true;
        emit ContratoAceito(msg.sender);
    }

    // Inicia o serviço após aceite do contratante e contratado
    function iniciarServico() public {
        require(partes[servico.contratante].aceitou, "Contratante nao aceitou");
        require(partes[servico.contratado].aceitou, "Contratado nao aceitou");
        servico.status = Status.EmAndamento;
        emit ServicoIniciado();
    }

    // Conclui o serviço (somente o contratado pode executar)
    function concluirServico() public apenasContratado {
        require(servico.status == Status.EmAndamento, "Servico nao iniciado");
        servico.status = Status.Concluido;
        emit ServicoConcluido();
    }

    // Reconhecimento jurídico do contrato (somente o advogado pode executar)
    function reconhecerJuridicamente() public apenasAdvogado {
        require(servico.status == Status.Concluido, "Servico nao concluido");
        servico.reconhecidoJuridicamente = true;
        emit ReconhecimentoJuridico(msg.sender);
    }

    // Pagamento do serviço (somente o contratante pode executar)
    function pagarServico() public payable nonReentrant apenasContratante {
        require(servico.status == Status.Concluido, "Servico nao concluido");
        require(servico.reconhecidoJuridicamente, "Contrato nao reconhecido juridicamente");
        require(msg.value >= servico.valor, "Valor insuficiente");
        payable(servico.contratado).transfer(servico.valor);
        emit PagamentoRealizado(msg.sender, msg.value);
    }

    // Cancelamento do contrato (qualquer parte pode executar antes da conclusão)
    function cancelarContrato() public apenasParte {
        require(servico.status != Status.Concluido, "Nao pode cancelar apos conclusao");
        servico.status = Status.Cancelado;
        emit ContratoCancelado(msg.sender);
    }

    // Retorna o status atual do serviço como texto
    function getStatus() public view returns (string memory) {
        if (servico.status == Status.Criado) return "Criado";
        if (servico.status == Status.Aceito) return "Aceito";
        if (servico.status == Status.EmAndamento) return "Em andamento";
        if (servico.status == Status.Concluido) return "Concluido";
        if (servico.status == Status.Cancelado) return "Cancelado";
        return "Desconhecido";
    }

    // Retorna o link IPFS dos termos em papel
    function getLinkTermos() public view returns (string memory) {
        return servico.ipfsLinkTermos;
    }
}

